import React, { Component } from 'react';

class Header extends Component {
  render() {
    return(
      <div className="header">
      <h1>Who's Time?</h1>
      <div className="input">
      <input placeholder="Whatcha Thinkin?" />
      <button>Click Here</button>
      </div>
      </div>
      )
  }
}

export default Header
